import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Home() {
    const [myData, setMyData] = useState([]);
    
    useEffect(() => {
        axios
            .get("https://jsonplaceholder.typicode.com/posts")
            .then((res) =>
                setMyData(res.data)
            );
    }, []);

    return (
        <>
            <h1>API Calling using Axios</h1>
        </>
    )
}

export default Home
